function nN(name){let n=name.toLowerCase().replace(/\./g,'').replace(/\s+(jr|sr|ii|iii|iv|v)\.?\s*$/i,'').replace(/\s+/g,' ').trim();const p=n.split(' ');if(NA[p[0]])p[0]=NA[p[0]];n=p.join(' ');return MA[n]||n;}
function nS(s){let v=s.toLowerCase().replace(/\s*\(fl\)/i,'').replace(/\s*\(oh\)/i,'').replace(/n\.c\.\s*state/i,'nc state').replace(/\./g,'').replace(/\s+/g,' ').trim();return SA[v]||v;}
export function getProspectStats(name,school){const k=nN(name)+'|'+nS(school);if(S[k])return S[k];const n=nN(name);for(const x in S){if(x.startsWith(n+'|'))return S[x];}return null;}
export default S;